import './App.css';
import Button from '@mui/material/Button';
function App() {
  const click = () => {
    console.log('clicked');
  };
  return (
    <div className="App">
      <Button onClick={click} variant="text">
        Text
      </Button>
    </div>
  );
}

export default App;
